$(function () {
    $("#ver").text("2");
    initAudioTag();
    $("button").click(function () {
        document.getElementById("bgm").play();
    });
});

function initAudioTag() {
    var audio = $("<audio preload='auto'></audio>");
    audio.attr("id", "bgm");
    audio.attr("loop", "loop");

    var source = $("<source type='audio/mp3'>");
    source.attr("src", getSrc1());
    audio.append(source);
    $("#test").append(audio);
    document.getElementById("bgm").load();
}

function getSrc0() {
    return "Content/Audio/main.mp3";
}

function getSrc1() {
    return "data:audio/mp3;base64,";
}